export default function Box(){
    const [num, setNum] = useState(0) 

    function pluss(){
        setNum(num + 1) 
    }
    function Coin(){
        return(
            <div classname="coin "></div>
        )
    }
    return(
       <div onClick={pluss} className="box">
        <h1>{num}</h1>

       </div> 
    )
}
